	'messages:apihelp-compare-summary' => 'en:Get the difference between two pages.',
	'messages:apihelp-compare-extended-description' => 'en:A revision number, a page title, a page ID, text, or a relative reference for both "from" and "to" must be passed.',
	'messages:apihelp-compare-param-fromtitle' => 'en:First title to compare.',
	'messages:apihelp-compare-param-fromid' => 'en:First page ID to compare.',
	'messages:apihelp-compare-param-fromrev' => 'en:First revision to compare.',
	'messages:apihelp-compare-param-frompst' => 'en:Do a pre-save transform on <var>fromtext-&#x7B;slot}</var>.',
	'messages:apihelp-compare-param-fromslots' => 'en:Override content of the revision specified by <var>fromtitle</var>, <var>fromid</var> or <var>fromrev</var>.

This parameter specifies the slots that are to be modified. Use <var>fromtext-&#x7B;slot}</var>, <var>fromcontentmodel-&#x7B;slot}</var>, and <var>fromcontentformat-&#x7B;slot}</var> to specify content for each slot.',
	'messages:apihelp-compare-param-fromtext-{slot}' => 'en:Text of the specified slot. If omitted, the slot is removed from the revision.',
	'messages:apihelp-compare-param-fromsection-{slot}' => 'en:When <var>fromtext-&#x7B;slot}</var> is the content of a single section, this is the section identifier. It will be merged into the revision specified by <var>fromtitle</var>, <var>fromid</var> or <var>fromrev</var> as if for a section edit.',
	'messages:apihelp-compare-param-fromcontentmodel-{slot}' => 'en:Content model of <var>fromtext-&#x7B;slot}</var>. If not supplied, it will be guessed based on the other parameters.',
	'messages:apihelp-compare-param-fromcontentformat-{slot}' => 'en:Content serialization format of <var>fromtext-&#x7B;slot}</var>.',
	'messages:apihelp-compare-param-fromtext' => 'en:Specify <kbd>fromslots=main</kbd> and use <var>fromtext-main</var> instead.',
	'messages:apihelp-compare-param-fromcontentmodel' => 'en:Specify <kbd>fromslots=main</kbd> and use <var>fromcontentmodel-main</var> instead.',
	'messages:apihelp-compare-param-fromcontentformat' => 'en:Specify <kbd>fromslots=main</kbd> and use <var>fromcontentformat-main</var> instead.',
	'messages:apihelp-compare-param-fromsection' => 'en:Only use the specified section of the specified \'from\' content.',
	'messages:apihelp-compare-param-totitle' => 'en:Second title to compare.',
	'messages:apihelp-compare-param-toid' => 'en:Second page ID to compare.',
	'messages:apihelp-compare-param-torev' => 'en:Second revision to compare.',
	'messages:apihelp-compare-param-torelative' => 'en:Use a revision relative to the revision determined from <var>fromtitle</var>, <var>fromid</var> or <var>fromrev</var>. All of the other \'to\' options will be ignored.',
	'messages:apihelp-compare-param-topst' => 'en:Do a pre-save transform on <var>totext</var>.',
	'messages:apihelp-compare-param-toslots' => 'en:Override content of the revision specified by <var>totitle</var>, <var>toid</var> or <var>torev</var>.

This parameter specifies the slots that are to be modified. Use <var>totext-&#x7B;slot}</var>, <var>tocontentmodel-&#x7B;slot}</var>, and <var>tocontentformat-&#x7B;slot}</var> to specify content for each slot.',
	'messages:apihelp-compare-param-totext-{slot}' => 'en:Text of the specified slot. If omitted, the slot is removed from the revision.',
	'messages:apihelp-compare-param-tosection-{slot}' => 'en:When <var>totext-&#x7B;slot}</var> is the content of a single section, this is the section identifier. It will be merged into the revision specified by <var>totitle</var>, <var>toid</var> or <var>torev</var> as if for a section edit.',
	'messages:apihelp-compare-param-tocontentmodel-{slot}' => 'en:Content model of <var>totext-&#x7B;slot}</var>. If not supplied, it will be guessed based on the other parameters.',
	'messages:apihelp-compare-param-tocontentformat-{slot}' => 'en:Content serialization format of <var>totext-&#x7B;slot}</var>.',
	'messages:apihelp-compare-param-totext' => 'en:Specify <kbd>toslots=main</kbd> and use <var>totext-main</var> instead.',
	'messages:apihelp-compare-param-tocontentmodel' => 'en:Specify <kbd>toslots=main</kbd> and use <var>tocontentmodel-main</var> instead.',
	'messages:apihelp-compare-param-tocontentformat' => 'en:Specify <kbd>toslots=main</kbd> and use <var>tocontentformat-main</var> instead.',
	'messages:apihelp-compare-param-tosection' => 'en:Only use the specified section of the specified \'to\' content.',
	'messages:apihelp-compare-param-prop' => 'en:Which pieces of information to get.',
	'messages:apihelp-compare-paramvalue-prop-diff' => 'en:The diff HTML.',
	'messages:apihelp-compare-paramvalue-prop-diffsize' => 'en:The size of the diff HTML, in bytes.',
	'messages:apihelp-compare-paramvalue-prop-rel' => 'en:The revision IDs of the revision previous to \'from\' and after \'to\', if any.',
	'messages:apihelp-compare-paramvalue-prop-ids' => 'en:The page and revision IDs of the \'from\' and \'to\' revisions.',
	'messages:apihelp-compare-paramvalue-prop-title' => 'en:The page titles of the \'from\' and \'to\' revisions.',
	'messages:apihelp-compare-paramvalue-prop-user' => 'en:The username and ID of the \'from\' and \'to\' revisions. If the user has been revision deleted, a <samp>fromuserhidden</samp> or <samp>touserhidden</samp> property will be returned.',
	'messages:apihelp-compare-paramvalue-prop-comment' => 'en:The comment on the \'from\' and \'to\' revisions. If the comment has been revision deleted, a <samp>fromcommenthidden</samp> or <samp>tocommenthidden</samp> property will be returned.',
	'messages:apihelp-compare-paramvalue-prop-parsedcomment' => 'en:The parsed comment on the \'from\' and \'to\' revisions. If the comment has been revision deleted, a <samp>fromcommenthidden</samp> or <samp>tocommenthidden</samp> property will be returned.',
	'messages:apihelp-compare-paramvalue-prop-size' => 'en:The size of the \'from\' and \'to\' revisions.',
