	'messages:config-profile' => 'en:User rights profile:',
	'messages:config-profile-wiki' => 'en:Open wiki',
	'messages:config-profile-no-anon' => 'en:Account creation required',
	'messages:config-profile-fishbowl' => 'en:Authorized editors only',
	'messages:config-profile-private' => 'en:Private wiki',
	'messages:config-profile-help' => 'en:Wikis work best when you let as many people edit them as possible.
In MediaWiki, it is easy to review the recent changes, and to revert any damage that is done by naive or malicious users.

However, many have found MediaWiki to be useful in a wide variety of roles, and sometimes it is not easy to convince everyone of the benefits of the wiki way.
So you have the choice.

The <strong>{{int:config-profile-wiki}}</strong> model allows anyone to edit, without even logging in.
A wiki with <strong>{{int:config-profile-no-anon}}</strong> provides extra accountability, but may deter casual contributors.

The <strong>{{int:config-profile-fishbowl}}</strong> scenario allows approved users to edit, but the public can view the pages, including history.
A <strong>{{int:config-profile-private}}</strong> only allows approved users to view pages, with the same group allowed to edit.

More complex user rights configurations are available after installation, see the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:User_rights relevant manual entry].',
	'messages:config-license' => 'en:Copyright and license:',
	'messages:config-license-none' => 'en:No license footer',
	'messages:config-license-cc-by-sa' => 'en:Creative Commons Attribution-ShareAlike',
	'messages:config-license-cc-by' => 'en:Creative Commons Attribution',
	'messages:config-license-cc-by-nc-sa' => 'en:Creative Commons Attribution-NonCommercial-ShareAlike',
	'messages:config-license-cc-0' => 'en:Creative Commons Zero (Public Domain)',
	'messages:config-license-gfdl' => 'en:GNU Free Documentation License 1.3 or later',
	'messages:config-license-pd' => 'en:Public Domain',
	'messages:config-license-help' => 'en:Many public wikis put all contributions under a [https://freedomdefined.org/Definition free license].
This helps to create a sense of community ownership and encourages long-term contribution.
It is not generally necessary for a private or corporate wiki.

If you want to be able to use text from Wikipedia, and you want Wikipedia to be able to accept text copied from your wiki, you should choose <strong>{{int:config-license-cc-by-sa}}</strong>.

Wikipedia previously used the GNU Free Documentation License.
The GFDL is a valid license, but it is difficult to understand.
It is also difficult to reuse content licensed under the GFDL.',
